import React from "react";

const Panel = ({
  flx = "0 0 0",
  p = 0,
  h,
  classes = { container: [], panel: [] },
  children,
}) => {
  return (
    <div
      className={classes.container.reduce(
        (x, next) => x.toString() + " " + next.toString(),
        "pnl"
      )}
    >
      <div
        className={classes.panel.reduce(
          (x, next) => x.toString() + " " + next.toString(),
          "pnl"
        )}
      >
        {children}
      </div>
    </div>
  );
};

export default Panel;
